import React from 'react';
const AccSpam = () => {
  return (
    <div className="accSpam">
        <h1>Acc Spam</h1>
        <p>Chức năng này đang được phát triển.</p>
        <p>Vui lòng quay lại sau.</p>
    </div>
    
  ); 
}
export default AccSpam;
